import React from 'react';
import { Link } from 'react-router-dom';
import { Image, List } from 'semantic-ui-react';

const ContactList = ({ contacts }) => {
	return (
		<List>
			{contacts
				? contacts.map((contact) => (
						<List.Item
							as={Link}
							to={'/user/messenger/page'}
							oncClick={() => console.log('CCCCCCCCCCLLLLLLLIIIIICCKKKKKEEEEEEDDDD')}
						>
							<Image avatar src={contact.contactImageUrl} />
							<List.Content>
								<List.Header as="a">{contact.contactName}</List.Header>
								<List.Description>... online</List.Description>
							</List.Content>
						</List.Item>
				  ))
				: ''}
		</List>
	);
};

export default ContactList;
